import React from 'react';
import { Route, Switch } from 'react-router-dom';
import { App, About } from './containers';

const Routes = () => (
  <Switch>
    <Route exact path="/" component={App} />
    <Route path="/about" component={About} />
  </Switch>
);

export default Routes;
